js代码规范
  前端开发团队遵循和约定的代码书写规范，意在提高代码的规范性和可维护性, 同时良好的代码习惯也能充分体现个人的职业素养。
基本格式

代码统一采用Tab缩进（4个空格，可以在编辑器设置），如：vscode 可在 文件-首选项-设置-"editor.tabSize": 4

语句的结尾处可看个人习惯是否加分号，建议加上分号，这是一个好习惯，特别是在代码会被压缩的情况下。

模块代码AMD方式组织。define(), 模块依赖用 commonjs require()
define(function(require, exports, module) {
   'use strict';

   var _ = require('underscore');

   var queue = [];

   var initModule = function() {
       _.each(queue, function(v, i) {
           // do something
       });
   };

   module.exports = {
       init: initModule
   };
});


字符串变量值统一用单引号(')
var s = 'hello world';
var html = '';
console.log(s + ', my name is cat');


注意使用空格/空行
完整示例
function walk(holder, key) {

   // The walk method is used to recursively walk the resulting structure so
   // that modifications can be made.

   var k, v, value = holder[key];
   if (value && typeof value === 'object') {
       for (k in value) {
           if (Object.prototype.hasOwnProperty.call(value, k)) {
               v = walk(value, k);
               if (v !== undefined) {
                   value[k] = v;
               } else {
                   delete value[k];
               }
           }
       }
   }

   return reviver.call(holder, key, value);
}

需要前后加空格的运算符包括:
=, ==, ===, !=, !==, >, = , ? :, -, +, +=, -=, /, *, %, &&, &, ||, |, {}
不需要出现空格的包括: ;, ., (), []
后边带空格的包括:
,, if, for, while, do, catch, with, new,
非三元表达式中的:
a += 2;
b = true ? a : 1;

括号中的参数之间加空格:
get(x, b, c);
function get(a, b, c) {
   // work with a,b,c
}

注释符前后要有空格
代码段前后保留空行, 类，方法，函数前后保留空行
6. 避免使用全局变量, 如果不能避免则尽量减少数量;
7. 三元操作符不要涉及大段的复杂的代码, 如果可以请改为 if else;
8. 奇淫技巧必须注释, 注释应该更多地体现为什么要这样，而不是会怎么样;
9. 将每条语句放置在一个单独的代码行中保持可读性, 不要出现 aNum++; anOtherNum++;在同一行, var 也一样;
(√)
aNum++;
anOtherNum++;

(╳)
aNum++; anOtherNum++;



命名规范
  通常,使用 functionNamesLikeThis, variableNamesLikeThis, ClassNamesLikeThis, EnumNamesLikeThis, methodNamesLikeThis, 和 SYMBOLICCONSTANTSLIKE_THIS.

常规的命名方式
var variableNamesLikeThis = '...',  // 变量
   CONSTANTS_LIKE_THIS = '...';    // 常量

// 函数
function functionNamesLikeThis() {
   ...
};

// 构造类
function ClassNamesLikeThis() {
   ...
};

// 方法&属性等
ClassNamesLikeThis.methodNamesLikeThis = function(){
   ...
};


属性和方法
文件或类中的私有属性, 变量和方法名应该以下划线 "_" 开头.
保护属性, 变量和方法名不需要下划线开头, 和公共变量名一样.
方法名按描述过程或描述项的方式, 动名词结合. 来命名, 以小写字母开头, 连接词使用混合大小写的驼峰形式, 例如: getAncestorByTagName.

方法和函数参数
函数的参数个数不固定时, 应该添加最后一个参数 args 为参数的个数. 你也可以不设置 args 而取代使用 arguments.
可选和可变参数应该在 @param (Optional) 标记中说明清楚.

Getters 和 Setters
不强制要求使用Getters和Setters，但当你使用时，Getters应该命名成getFoo()形式，同理Setters应该名称成setFoo(v)形式
对于返回值是布尔类型（Boolean）的Getters方法也可以写成isFoo()的形式
// 定义一个叫学生的构造类
function Student() {
   ...
};

Student.prototype.getName = function() {
   ...
};

Student.prototype.setName = function(name) {
   ...
};

// 返回值为布尔类型的Getters方法
Student.prototype.isGirl= function() {
   if (...) {
       return true;
   } else {
       return false;
   }
};


私有
如果你要把构造类的方法，变量或属性设置为私有的话，请用下划线开头来命名，如：“_privite”

文件名应该使用小写字符, 以避免在有些系统平台上不识别大小写的命名方式. 文件名以.js结尾, 不要包含除 "-"外的标点符号，jquery插件看情况定.

构造函数.
使用首字母大写的形式, 通常为名词, 例如: Class;
但是, 对于内部基类, 也就是不直接调用生成实例的基类, 使用 _ 和首字母大写的形式命名, 例如: _Base;

布尔值以 is 开头的驼峰形式, 例如 var isGirl = true;

this命名, 尽量以能表达当前实例意义的名称, 通用命名为self;
Pager.protoype.goto = function() {
   var pager = this, index = page.currentIndex + 1;
   setTimeout(function() {
       page.doRequest(index);
   });
};
function foo1(){
   var self = this;
   setTimeout(function() {
       console.log(self.name);
   }, 1);
}
function foo2(name){
   var self = this;
   self.name = name;
   foo1.call(self);
}


在循环中, 尽量使用单字符变量名称, 例如: i, j, k, m, n;

避免使用保留字或语言构造命名;
abstract boolean break byte case catch char class const
continue default do double else extends false final finally
float for function goto if implements import in instanceof
int interface long native new null package private protected
public return short assets super switch synchronized this
throw throws transient true try var void while with

尽量保持所有名称最短, 但是一定要保证名称具有描述性;

js钩子命名必须以j开头的驼峰命名，并且不能此钩子不能有应用样式
(√)
提交
提交

(╳)
提交
提交



基本格式

变量声明
变量使用var语句声明
变量使用前必须先声明
尽量减少使用全局变量，全局变量使用“g”开头
同一作用域块内的变量尽量使用一个“var”语句来声明
(√)
var gName = '';
function foo() {
   var name = '...',
       sex = '...',
       age = '';
   ....
};

(╳)
var name = '';
function foo() {
   var name = '...';
   var sex = '...';
   var age = '';
   ....
};


字符串
用单引号包裹：创建字符串对象时，优先使用单引号，当你的字符串中包含html代码片段时将格外方便
var myString = '待我长发及腰时那还是人吗？  不是，绝对是神！';

长字符串:
字符串太长需要换行时，不要使用转义符“\”来处理行尾的换行，请用字符串相加来替换
在编译时, 不能忽略行起始位置的空白字符; "\" 后的空白字符会产生奇怪的错误; 虽然大多数脚本引擎支持这种写法, 但它不是 ECMAScript
的标准规范.
(√)
var myString = '带我长发及腰时'+
   '那还是人吗？ '+
   '不是，绝对是神！';

(╳)
var myString = '带我长发及腰时 \
   那还是人吗？ \
   不是，绝对是神！ \';

建议使用es6的反撇号 ``, 注意此用法需babel转译才能兼容浏览器
var name = '上帝';
var myString = `带我长发及腰时那还是人吗,${name}?`


常量
常量的形式如: NAMES_LIKE_THIS, 即使用大写字符, 并用下划线分隔.
var SECONDS_IN_A_MINUTE = 60;


总是使用分号.
如果仅依靠语句间的隐式分隔, 有时会很麻烦. 你自己更能清楚哪里是语句的起止.而且有些情况下, 漏掉分号会很危险:

函数声明
尽量不要使用全局函数
内部函数应该跟在 var 语句后面
不要在语句块内声明函数，如果确实需要，请使用函数表达式：
同一作用域块内的变量尽量使用一个“var”语句来声明
(√)
// 但仍旧不建议在语句块内声明函数，即使是表达式的方式
if (...) {
   var fooName = function() {
       ...;
   };
}

(╳)
if (...) {
   function fooName() {
       ...;
   }
}


块内函数声明: 不要在块内声明一个函数. 
不要写成.
(╳)
if (x) {
   function foo() {}
}

虽然很多 JS 引擎都支持块内声明函数, 但它不属于 ECMAScript 规范 (见 ECMA-262, 第13和14条).
各个浏览器糟糕的实现相互不兼容, 有些也与未来 ECMAScript 草案相违背. ECMAScript 只允许在脚本的根语句或函数中声明函数.
如果确实需要在块中定义函数, 建议使用函数表达式来初始化变量:
if (x) {
   var foo = function() {}
}


闭包，用起来要小心，因为如果处理不当很容易导致内存泄漏. 及时释放闭包变量引用, destory() 方法的设计. 

eval(): 只用于解析序列化串
eval() 会让程序执行的比较混乱, 当eval()里面包含用户输入的话就更加危险. 可以用其他更佳的, 更清晰, 更安全的方式写你的代码,
所以一般情况下请不要使用eval(). 当碰到一些需要解析序列化串的情况下, 使用eval很容易实现.
这是一个常用的input标签里面的属性


我们通常如此调用(基于jquery实现)
var user = $("#jUser").attr("data-user");
var user = eval('('+user+')');
console.log(user.name);


with() {}: 不要使用 

this: 仅在对象构造器, 方法, 闭包中使用. 
this的语义很特别. 有时它引用一个全局对象(大多数情况下), 调用者的作用域(使用 eval时), DOM 树中的节点(添加事件处理函数时),
新创建的对象(使用一个构造器), 或者其他对象(如果函数被call() 或apply()).
使用时很容易出错, 所以只有在下面两个情况时才能使用:
在构造器中 对象的方法(包括创建的闭包)中

for-in 循环: 只用于 object/map/hash 的遍历,对 Array 用 for-in 循环有时会出错. 因为它并不是从 0 到 length - 1 进行遍历, 而是所有出现在对象及其原型链的键值. 下面就是一些失败的使用案例: 
// 本来只要输出0，1；结果输出了0,1,djune;
var a = [0, 1];
a.buhu = 'djune';
for (var i in a) {
  console.log(a[i]);
}


尽量不修改内置对象的原型 
千万不要修改内置对象, 如Object.prototype和Array.prototype 的原型. 而修改内置对象, 如
Function.prototype的原型, 虽然少危险些, 但仍会导致调试时的诡异现象. 所以也要避免修改其原型.

Object{}和 Array[]
使用“{}”替代“new Object()”来创建对象
使用“[]”替代“new Array()”来创建数组,使用 Array 构造器很容易因为传参不恰当导致错误
var obj = {
  a: 1,
  b: 2,
  'say hello': 'hello'
};

var arr = [1, 2, 'hello'];


进行对比操作时，尽量使用“===”和“!==”

docs/Eslint.html.body:
ESLint是一个用来检测 ECMAScript代码， 并且按照规则给出报告的代码检测工具，使用它可以避免低级错误和统一代码的风格。ESLint被设计为完全可配置的
安装
全局安装
npm i -g eslint
局部安装（推荐）
npm i -D eslint
安装完毕后，接下来新建一个配置文件.eslintrc.js，或者使用如下的命令行来自动生成。
eslint --init
配置文件优先级：

eslintrc.js(输出一个配置对象)
eslintrc.yaml
eslintrc.yml
eslintrc.json（ESLint的JSON文件允许JavaScript风格的注释）
eslintrc（可以是JSON也可以是YAML）
package.json（在package.json里创建一个eslintConfig属性，在那里定义你的配置）

你可以通过在项目根目录创建一个.eslintignore文件告诉ESLint去忽略特定的文件和目录
规则
指定执行环境
JavaScript 代码可以运行在浏览器或 nodejs 等环境中，每个环境的全局变量都不尽相同（如 nodejs 中没有 window全局变量）。在配置文件中可以自由的指定执行环境。
module.exports = {
  env: {
    browser: true,
    node: true,
  },
};
在配置文件中可以设置一些规则。
这些规则的等级有三种：

"off" 或者 0：关闭规则。
"warn" 或者 1：打开规则，并且作为一个警告（不影响exit code）。
"error" 或者 2：打开规则，并且作为一个错误（exit code将会是1）。

配置说明
{
  //ESLint默认使用Espree作为其解析器
  //同时babel-eslint也是用得最多的解析器
  "parser": "espree",
  //parser解析代码时的参数
  "parserOption": {
    //指定要使用的ECMAScript版本，默认值5
    "ecmaVersion": 5,
    //设置为script(默认)或module（如果你的代码是ECMAScript模块)
    "sourceType": "script",
    //这是个对象，表示你想使用的额外的语言特性,所有选项默认都是false
    "ecmafeatures": {
      //允许在全局作用域下使用return语句
      "globalReturn": false,
      //启用全局strict模式（严格模式）
      "impliedStrict": false,
      //启用JSX
      "jsx": false,
      //启用对实验性的objectRest/spreadProperties的支持
      "experimentalObjectRestSpread": false
    }
  },
  //指定环境，每个环境都有自己预定义的全局变量，可以同时指定多个环境，不矛盾
  "env": {
    //效果同配置项ecmaVersion一样
    "es6": true,
    "browser": true,
    "node": true,
    "commonjs": false,
    "mocha": true,
    "jquery": true,
     //如果你想使用来自某个插件的环境时，确保在plugins数组里指定插件名
     //格式为：插件名/环境名称（插件名不带前缀）
    "react/node": true
  },
  //指定环境为我们提供了预置的全局变量
  //对于那些我们自定义的全局变量，可以用globals指定
  //设置每个变量等于true允许变量被重写，或false不允许被重写
  "globals": {
    "globalVar1": true,
    "globalVar2": false
  },
  //ESLint支持使用第三方插件
  //在使用插件之前，你必须使用npm安装它
  //全局安装的ESLint只能使用全局安装的插件
  //本地安装的ESLint不仅可以使用本地安装的插件还可以使用全局安装的插件
  //plugin与extend的区别：extend提供的是eslint现有规则的一系列预设
  //而plugin则提供了除预设之外的自定义规则，当你在eslint的规则里找不到合适的的时候
  //就可以借用插件来实现了
  "plugins": [
    "eslint-plugin-airbnb",
    //插件名称可以省略eslint-plugin-前缀
    "react"
  ],
  //具体规则配置
  //off或0--关闭规则
  //warn或1--开启规则，警告级别(不会导致程序退出)
  //error或2--开启规则，错误级别(当被触发的时候，程序会退出)
  "rules": {
    "eqeqeq": "warn",
    //你也可以使用对应的数字定义规则严重程度
    "curly": 2,
    //如果某条规则有额外的选项，你可以使用数组字面量指定它们
    //选项可以是字符串，也可以是对象
    "quotes": ["error", "double"],
    "one-var": ["error", {
      "var": "always",
      "let": "never",
      "const": "never"
    }],
    //配置插件提供的自定义规则的时候，格式为：不带前缀插件名/规则ID
    "react/curly": "error"
  },
  //ESLint支持在配置文件添加共享设置
  //你可以添加settings对象到配置文件，它将提供给每一个将被执行的规则
  //如果你想添加的自定义规则而且使它们可以访问到相同的信息，这将会很有用，并且很容易配置
  "settings": {
    "sharedData": "Hello"
  },
  //Eslint检测配置文件步骤：
  //1.在要检测的文件同一目录里寻找.eslintrc.*和package.json
  //2.紧接着在父级目录里寻找，一直到文件系统的根目录
  //3.如果在前两步发现有root：true的配置，停止在父级目录中寻找.eslintrc
  //4.如果以上步骤都没有找到，则回退到用户主目录~/.eslintrc中自定义的默认配置
  "root": true,
  //extends属性值可以是一个字符串或字符串数组
  //数组中每个配置项继承它前面的配置
  //可选的配置项如下
  //1.字符串eslint：recommended，该配置项启用一系列核心规则，这些规则报告一些常见问题，即在(规则页面)中打勾的规则
  //2.一个可以输出配置对象的可共享配置包，如eslint-config-standard
    //可共享配置包是一个导出配置对象的简单的npm包，包名称以eslint-config-开头，使用前要安装
    //extends属性值可以省略包名的前缀eslint-config-
  //3.一个输出配置规则的插件包，如eslint-plugin-react
    //一些插件也可以输出一个或多个命名的配置
    //extends属性值为，plugin：包名/配置名称
  //4.一个指向配置文件的相对路径或绝对路径
  //5.字符串eslint：all，启用当前安装的ESLint中所有的核心规则
    //该配置不推荐在产品中使用，因为它随着ESLint版本进行更改。使用的话，请自己承担风险
  "extends": [
    "eslint:recommended",
    "standard",
    "plugin:react/recommended",
    "./node_modules/coding-standard/.eslintrc-es6",
    "eslint:all"
  ]
}

规则参考官方文档
